10.body:
There are two types of code transactions in Move: module and script. Module is a deployment of new module (which then will be accessible under the address of sender); Script is a transaction-as-code in which you can use deployed modules as well as the standard library as dependencies. Module code starts with module keyword and its code looks like this. Inside module you can define: new types (as structs), methods and resource structs. module MyModule { struct hi_fives { count: u8 } public fun high_five(): u8 { 5 }
} Script must contain main function and usually uses deployed modules. See imports on how to import modules. script { // assume that sender address was 0xAF use {{sender}}::MyModule; fun main() { MyModule::high_five(); }
}

17.body:
script { fun empty() { // this is a comment line }
} You can use double-slash " // " to write line comments. Rules are simple - everything after " // " is considered a comment to the end of line. You can use line comments to leave short notes for other developers or to comment out some code to remove it from execution chain. script { // let's add a note to everything! fun check_this(): u8 { let a = 10; // let b = 10 this line is commented and won't be executed let b = 5; // here comment is placed after code a + b // result is 15, not 10! }
}

23.body:
You can (and sometimes must) add else to your if construction: script { use 0x0::Transaction; fun main(custom_addr: address) { if (custom_addr != Transaction::sender()) { abort 11 } else { let _ = true }; // alternatively if (custom_addr != Transaction::sender()) abort 11 else { let _ = true }; }
} Syntax with else: if (<EXPRESSION>) <EXPRESSION>
else <EXPRESSION>;

24.body:
In Move you have two ways to do repetition: conditional loop with while and infinite loop. Use while loop with bool expression inside parentheses: fun main() { let i = 0; while (i < 5) { i = i + 1; }
} For infinite (non-conditional) loops use loop keyword with expression: fun main() { let i = 0; loop { i = i + 1; if (i == 5) break }
} Syntax for loops: while (<EXPRESSION>) <EXPRESSION>;
loop <EXPRESSION>;

25.body:
Keywords continue and break allow you to skip one round or break iteration. For example let's add two conditions into loop. If i is even we use continue to jump to next iteration without going through code after continue call. With break we stop iteration and exit loop. fun main() { let i = 0; loop { i = i + 1; if (i / 2 == 0) continue; if (i == 5) break; // assume we do something here }; // i here is 5
} About semicolons. If break and continue are the last keywords in scope, you can't put a semicolon after them as any code after won't be executed. Somehow even semi can't be put. See this: fun main() { let i = 0; loop { i = i + 1; if (i == 5) { break; // will result in compiler error. correct is `break` without semi // Error: Unreachable code } // same with continue here: no semi, never; if (true) { continue } // however you can put semi like this, because continue and break here // are single expressions, hence they "end their own scope" if (true) continue; if (i == 5) break; }
}

28.body:
script { fun empty() { } fun sum(a: u8, b: u8): u8 { a + b }
} Here we've created sum function with two arguments inside parentheses: a and b . Let's learn few rules: Function arguments MUST have types specified and MUST be separated by comma; Function return value (if there is one) is put after parentheses and requires a colon; Now how would we call function sum? Here's a sample. script { fun sum(a: u8, b: u8): u8 { a + b } fun gimme_five_and_five(): u8 { let ten = sum(5, 5); ten }
}

30.body:
In previous examples we've experimented with functions with no return value or with single. But what if I told you that you can return multiple values of any type. Curious? Let's proceed! To specify multiple return values you need to use parentheses: script { fun max(a: u8, b: u8): (u8, bool) { if (a > b) { (a, false) } else if (a < b) { (b, false) } else { (a, true) } }
} This function takes two arguments: a and b and also returns two values : first is the max value and second is a boolean whether numbers entered are equal. Take closer look at the syntax: instead of specifying singe return argument we've added parenteses and have listed return argument types. Now let's see how we can use result of this function in let statement. script { // max function is defined ... fun main(): u64 { let (m, is_equal) = max(99, 100); if (is_equal) { m = m * 2; } (m as u64) }
} In this example we've destructed a tuple: created two new variables with values and types of return values of function max . Order is preserved and variable m here gets type u8 and now stores max value, whereas is_equal is a bool . Two is not the limit - number of returned arguments is up to you, though you'll soon learn about structs and see alternative way to return complex data.

35.body:
To import module from address use this pattern: use {{sender}}::ModuleName; In module context import MUST be placed inside module definition: module Lebowski { use {{sender}}::TheRug; public fun get_the_rug_back() { TheRug::tie_the_room_together(); }
} In script context import MUST be placed before main(). // script context
script { use {{sender}}::Lebowski; fun the_dude() { Lebowski::get_the_rug_back(); }
}

40.body:
Again: struct can be defined only inside module context. module RecordsCollection { // struct can contain no fields it's // initialization will be simple: // let d = Dummy {}; struct Dummy {} struct Record { author_id: u64, label_id: u64, year: u64, is_new: bool } // we can create new Record in a method public fun add_new(author_id: u64, label_id: u64, year: u64): Record { // when creating new struct use pattern: // <key>: <value> Record { author_id: author_id, label_id: label_id, year: year, is_new: true }; // you can could also use short notation when variable // name matches name of the property let record: Record = Record { author_id, label_id, year, is_new: true }; record } // since struct fields can only be accessed within module, you // have to provide interface to read structs if you pass it // outside of the module public fun print_year(r: Record): u64 { // to access struct's fields use "." (dot) notation r.year }
} Let's take a better look at add_new(...) function. Since struct is a new type, it can also be a return type, and you're able to see it in function definition: public fun add_new(author_id: u64, label_id: u64, year: u64): Record { /* ... */ } Okay. How can we use our Record struct after we published VinylShop module into network? // specify publisher's address script { use {{sender}}::VinylShop; fun add_new_record() { // we can use type-binding but we can't construct it - Rule #3 let record : VinylShop::Record = VinylShop::add_new(10, 10, 1999); // here we can pass record type but can't use `record.year` - Rule #4 if (VinylShop::print_year(record) == 1999) abort 11; }
}

47.body:
As said above you can use it everywhere. In module: module Countries { struct Country { name: vector<u8> } resource struct CountriesList { value: vector<Country> }
} And in script! script { use 0x0::Vector; fun vector_example() { let collection = Vector::empty<u8>(); Vector::push_back<u8>(&mut collection, 10); }
} In this example we've created an empty vector of u8 integers and filled it with one value. Please note that vector creation within code is only possible via 0x0::Vector library since this type is native.

5.body:
Move IDE proposes single way of organizing your directory structure. Create new directory for your project and open it in VSCode. Then setup this directory structure: modules/ - directory for our modules
scripts/ - directory for transaction scripts
out/ - this directory will hold compiled sources Also you'll need to create file called .mvconfig.json which will configure your working environment. This is a sample for libra: { "network": "libra", "sender": "0x1"
} Alternatively you can use dfinance as network: { "network": "dfinance", "sender": "0x1"
} dfinance uses bech32 'wallet1...' addresses, libra uses 16-byte '0x...' addresses. For local runs and experiments 0x1 address is enough - it's simple and short. Though when working with real blockchains in testnet or production environment you'll have to use correct address of network you've chosen.

51.body:
Resource in Move is defined as a resource struct and just like struct it can only be defined within module context, and unlike struct, resource will outlive your script. To understand that let's look at this example: // here's our module to manage records on chain
module RecordsCollection { use 0x0::Transaction as Tx; // the very basic information about our record struct Record { name: vector<u8>, author: vector<u8>, year: u64 } // imaginary collection of records struct Collection { records: vector<Record> } public fun create_record(name: vector<u8>, author: vector<u8>, year: u64): Record { Record { name, author, year } }
} What happens if we use module RecordsCollection in a script and call a method add_new()? New struct will be created in a script context. What happens when script scope ends? All defined variables and structs will be dumped: use {{sender}}::RecordsCollection as Collection; fun main(name: vector<u8>, author: vector<u8>, year: u64) { let r = Collection::create_record(name, author, year); // record is created but it saved somewhere? // where does it go when script ends? nowhere!
} Going further: even if we created Collection struct and pushed newly created Record in it, whole collection would still have been gone by the end of scope. That's when the resource struct comes into play. It can be saved, accessed, updated and destroyed. It outlives the script and affects blockchain state.

53.body:
First order of business - turning struct into resource struct. We will do it only for collection (you'll see why): resource struct Collection { records: vector<Record>
} Even better (or say more correct) way to name main resource in module is "T": // since whole module is named RecordsCollection
// everyone will understand that T equals Collection
resource struct T { records: vector<Record>
} As you can see, nothing but an addition of one keyword. What actually happens? Collection remains a type. Just like struct you can initialize it (in resource-specific way), you can push records into it and (!) what's really important: this resource struct will be saved on chain linked to your address making it possible to read and change it again in future transactions. Even more! If module is properly organized, you can even let other people see your collection, and (only if you want to do so!) you can let them add records into your collection. TLDR; It's time to code! Move has 5 built-in functions to work with collections, we'll go through all of them in order.

61.body:
For reference here's list of methods: exists<T>(<ADDRESS>); // check if resource exists at given address
move_to_sender<T>(T); // move newly created resource to sender // ones below require `acquires` keyword: borrow_global<T>(<ADDRESS>);
borrow_global_mut<T>(<ADDRESS>);
move_from<T>(<ADDRESS>); // destroy resource

7.body:
Create new file called high_fiver.move inside modules/ directory of your project. // modules/high_fiver.move
address 0x1 { module HighFiver { public fun gimme_five(): u8 { 5 }
} }

8.body:
Then create a script, let's call it me.move inside scripts/ directory: // scripts/me.move
script { use 0x1::HighFiver; use 0x0::Debug; fun main() { let five = HighFiver::gimme_five(); Debug::print<u8>(&five); }
} Then, while keeping your script open follow these steps: Toggle VSCode's command palette by pressing ⌘+Shift+P (on Mac) or Ctrl+Shift+P (on Linux/Windows) Type: >Move: Run Script and press enter or click when you see the right option. Voila! You should see execution result - log message with '5' printed in debug. If you don't see this window, go through this part again. Your directory structure should look like this: modules/ high_fiver.move
scripts/ me.move
out/
.mvconfig.json You can have as many modules as you want in your modules directory; all of them will be accessible in your scripts under address which you've specified in .mvconfig.json
